// DOM element that contains todo list
var listContainer = document.querySelector(".list-container");
// contains form for adding new todo item
var createTodoForm = document.querySelector("form");
// list containing all todo items
var todos = [];
// creates a new todo and sets it's creation and modification date to now
function createTodo(title, description) {
    var todo = {
        title: title,
        description: description,
        dateCreated: new Date(Date.now()),
        dateUpdated: new Date(Date.now()),
        done: false,
    };
    return todo;
}
// deletes a todo item from todos list given an index number
function deleteItem(i) {
    delete todos[i];
    printTodos();
}
// toggles an item's done status. takes todo's index as parameter
function toggleDone(i) {
    todos[i].done = !todos[i].done;
    todos[i].dateUpdated = new Date(Date.now());
    printTodos();
}
// for a given Date object returns a predefined formated string
function formatDate(d) {
    var t = d.toLocaleString("en-US", {
        hour: "2-digit",
        hour12: false,
        minute: "2-digit",
    });
    var day = d.toLocaleString("en-US", {
        day: "numeric",
    });
    var mAndY = d.toLocaleString("en-US", {
        month: "short",
        year: "numeric",
    });
    return "".concat(t, " - ").concat(day, ". ").concat(mAndY);
}
// creates and adds elements to the DOM
function printTodos() {
    listContainer.innerHTML = "";
    todos.forEach(function (t, i) {
        var li = document.createElement("li");
        var titleEl = document.createElement("h2");
        var descriptionEl = document.createElement("p");
        descriptionEl.className = "description";
        var dateCreatedEl = document.createElement("p");
        dateCreatedEl.className = "date";
        var dateUpdatedEl = document.createElement("p");
        dateUpdatedEl.className = "date";
        var actionsDiv = document.createElement("div");
        actionsDiv.className = "todo-actions";
        var deleteBtn = document.createElement("button");
        var toggleBtn = document.createElement("input");
        toggleBtn.type = "checkbox";
        if (t.done) {
            li.classList.add("done");
            toggleBtn.checked = true;
        }
        titleEl.innerText = t.title;
        descriptionEl.innerText = t.description;
        dateCreatedEl.innerText = "Created at: ".concat(formatDate(t.dateCreated));
        dateUpdatedEl.innerText = "Updated at: ".concat(formatDate(t.dateUpdated));
        deleteBtn.innerText = "Delete";
        deleteBtn.addEventListener("click", function (e) {
            deleteItem(i);
        });
        toggleBtn.addEventListener("change", function (e) {
            toggleDone(i);
        });
        li.appendChild(titleEl);
        li.appendChild(descriptionEl);
        li.appendChild(dateCreatedEl);
        li.appendChild(dateUpdatedEl);
        actionsDiv.appendChild(deleteBtn);
        actionsDiv.appendChild(toggleBtn);
        li.appendChild(actionsDiv);
        listContainer.appendChild(li);
    });
}
// on submiting the new todo createTodo() is called and
// the new todo object gets added to the global todo list
createTodoForm.addEventListener("submit", function (e) {
    e.preventDefault();
    var target = e.target;
    var newItem = createTodo(target.title.value, target.description.value);
    todos.push(newItem);
    printTodos();
});

